CREATE TABLE `_Logdur` (
  `LogId` int(11) NOT NULL AUTO_INCREMENT,
  `Referer` text NOT NULL,
  `Url` text NOT NULL,
  `UserAgent` text NOT NULL,
  `Ip` varchar(16) NOT NULL,
  `Tarih` date NOT NULL,
  PRIMARY KEY (`LogId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

